frame_eqs_eel:
warp = 0;
decay = .92;

wave_r = 0.1+0.2*sin(time);
wave_b = 0.4+0.4*sin(time*1.33);
wave_g = 0.8 + 0.2 * sin(time*1.2);

pixel_eqs_eel:
zoom = zoom - (.55+.1*sin(time));

zoom = zoom + abs(sin(rad*rad*rad*bass*8+time*5));

zoom = sqrt(pow(zoom,(0&rad*1.4)*.3));

warp:
shader_body { 
 vec4 tmpvar_1;
 tmpvar_1.w = 1.0;
 float tmpvar_2;
 tmpvar_2 = dot (texsize.zw, texsize.zw);
 vec2 tmpvar_3;
 tmpvar_3 = (uv - 0.5);
 tmpvar_1.xyz = ((max (
   max (texture (sampler_main, uv).xyz, texture (sampler_main, ((tmpvar_3 * (1.0 - 
     (8.0 * sqrt(tmpvar_2))
   )) + 0.5)).xyz)
 , texture (sampler_main, 
   ((tmpvar_3 * (1.0 + (8.0 * 
     sqrt(tmpvar_2)
   ))) + 0.5)
 ).xyz) - 0.03) * 0.98);
 ret = tmpvar_1.xyz;
}

comp:
shader_body { 
 vec4 tmpvar_1;
 tmpvar_1.w = 1.0;
 tmpvar_1.xyz = (texture (sampler_main, uv).xyz * 1.1);
 ret = tmpvar_1.xyz;
}

warp_hlsl:
shader_body
{
    // sample previous frame
    ret = tex2D( sampler_main, uv ).xyz;

    // feather pen
    ret = max(ret, tex2D( sampler_main, (uv-0.5)*(1-8*length(texsize.zw)) + 0.5 ).xyz);
    ret = max(ret, tex2D( sampler_main, (uv-0.5)*(1+8*length(texsize.zw)) + 0.5 ).xyz);

    // darken over time
    ret = (ret-0.03)*0.98;
}
